async function loadMNISTModel() {
    console.log("Création du modèle MNIST...");
    
    const model = tf.sequential({
        layers: [
            tf.layers.conv2d({
                filters: 32,
                kernelSize: 3,
                activation: 'relu',
                inputShape: [28, 28, 1],
                name: 'conv2d'
            }),
            tf.layers.maxPooling2d({
                poolSize: 2,
                name: 'max_pooling2d'
            }),
            tf.layers.conv2d({
                filters: 64,
                kernelSize: 3,
                activation: 'relu',
                name: 'conv2d_1'
            }),
            tf.layers.maxPooling2d({
                poolSize: 2,
                name: 'max_pooling2d_1'
            }),
            tf.layers.conv2d({
                filters: 64,
                kernelSize: 3,
                activation: 'relu',
                name: 'conv2d_2'
            }),
            tf.layers.flatten({
                name: 'flatten'
            }),
            tf.layers.dense({
                units: 64,
                activation: 'relu',
                name: 'dense'
            }),
            tf.layers.dropout({
                rate: 0.5,
                name: 'dropout'
            }),
            tf.layers.dense({
                units: 10,
                activation: 'softmax',
                name: 'dense_1'
            })
        ]
    });
    
    // Convertir les poids en tensors
    const weightTensors = MNIST_MODEL_WEIGHTS.map(weightArray => tf.tensor(weightArray));
    
    // Appliquer les poids
    model.setWeights(weightTensors);
    
    console.log("Modèle MNIST chargé avec succès!");
    console.log("Paramètres:", model.countParams());
    
    return model;
}

// Fonction de prédiction
async function predictDigit(imageData) {
    const model = await loadMNISTModel();
    
    // Preprocesser l'image (supposée 28x28)
    const tensor = tf.tensor4d(imageData, [1, 28, 28, 1]);
    const normalized = tensor.div(255.0);
    
    // Prédiction
    const prediction = model.predict(normalized);
    const probabilities = await prediction.data();
    
    // Nettoyer
    tensor.dispose();
    normalized.dispose();
    prediction.dispose();
    
    return Array.from(probabilities);
}
